import * as React from 'react'

/**
 * Muestra la lista de amigos.
 * @param props 
 * @returns 
 */

export default function FriendList(props: any) {
    return (
        <div>
            <h2>Friends:</h2>
            {
                props.user.friends.map((friend: any) => {
                   return <li color={
                       friend.status === "online" ? "color: green;" : "color: grey;"
                   } key={friend.name}>{friend.name} : {friend.status}</li>
                })
            }
        </div>
    )
}
